                        I'm a 2nd Year Computer Science Student at the University of manchester.
                        <br /> I'm passionate about building applications and learning new technologies.
                    </p>
                </div>
                <button className="btn btn-primary">Get in touch</button>
            </div>

        </section>
    );
}
